import React from 'react';

const App = (props) => {
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input></input>
        <button type="submit"></button> 
      </form>
    </div>
  )
}

const handleSubmit = (event) => {
  event.preventDefault()
  console.log('MORO!')
}


export default App;
